INSERT INTO `productos` VALUES (1,'Carpa 4 personas','Naturehike',18914.00,16,'camping','','','','Acampa cómodamente con las tres capacidades para dos, tres y cuatro personas de las carpas P Series de Naturehike. Sus varillas de aluminio la hacen liviana y resistente, mientras que su tela de poliéster anti desgarro es impermeable y cuenta con protección contra los rayos UV. Definitivamente una opción ideal para llevar en la mochila.','[\"El sobre techo está elaborado con poliéster antidesgarro 210T y revestimiento de poliuretano (PU) con índice de impermeabilidad de PU2000mm. Además, tiene UFP 50+ para protección contra los rayos UV. Finalmente, el sobre techo cuenta con dos ventanas de ventilación en los lados laterales de la carpa.\", \"El piso de la carpa es de tela Oxford 150D y tiene un índice impermeabilidad de PU2000mm.\", \"La tela de la estructura interna es de poliéster antidesgarro 210T junto con una malla transpirable. La malla es de alta densidad, por ende, evita la entrada de insectos. Gracias a eso, el interior de la tienda siempre es fresco y ventilado. Además, la carpa cuenta con dos accesos.\", \"Las varillas de aluminio 7001 son resistentes y garantizan un peso ligero. Además, el diseño inteligente del marco ayuda a reducir el tamaño de la carpa cuando está plegada.\", \"Incluye quince (15) estacas de aluminio, un (01) gancho para lámpara dentro de la carpa, un (01) bolsillo de malla interno.\", \"Peso: 2,8kg\"]',NULL,0,0,'2024-01-29 17:47:30','2024-02-01 19:08:29'),(2,'Ango Carpa','Naturehike',18914.00,33163,'camping','','','','Acampa cómodamente con las tres capacidades para dos, tres y cuatro personas de las carpas P Series de Naturehike. Sus varillas de aluminio la hacen liviana y resistente, mientras que su tela de poliéster anti desgarro es impermeable y cuenta con protección contra los rayos UV. Definitivamente una opción ideal para llevar en la mochila.','[\"Calidad por todas partes. Hecho de la tela 210T del poliester, impermeable 2000mm, grueso y durable. El soporte de la aleación de aluminio y la barra retractable hacen a la carpa entera más estable.\", \"Ventilación de cinco lados. La carpa adopta el diseño opuesto de puertas dobles y ventanas dobles, además de una gran ventana de ventilación en la parte superior para formar una ventilación de cinco lados.\", \"Diseño de gran vestíbulo. El espacioso diseño de vestíbulo frontal con puertas delanteras y traseras aumenta en gran medida el espacio de actividad.\", \"Montaje Rápido: Soporte automático, fácil de montar. Fortalece la estructura del soporte automático de aleación de aluminio telescópico de compresión elástica, y la construcción se completa cuando se despliega el soporte.\"]',NULL,0,0,'2024-01-29 17:50:04','2024-02-01 18:35:16'),(3,'Ottawa Carpa 6 P','National Geographic',262343.00,12,'camping','','','','Carpa con extensión frontal del cubretecho por medio de una varilla adicional con capacidad para 6 personas. Proporciona espacio en la entrada para dejar algunos implementos. Cuenta con ventilaciones laterales para mejor circulación del aire.','[\"Gancho en el techo para lámpara\", \"Costuras selladas\", \"Bolsillos de malla\", \"Piso en la entrada\", \"Protección UV\"]',NULL,0,0,'2024-01-29 17:52:48','2024-02-12 21:26:23'),(4,'Carpa Domo Large','Naturehike',262343.00,3,'camping','','','','Carpa de 2 plazas para expediciones y lugares con dura meteorología. Muy compacta, resistente y transpirable con una columna de agua de W/P 5000mm en el techo y suelo. Su faldón anti-ventisca con recogedores y costuras termo selladas protege de las condiciones atmosféricas más adversas y garantizan una buena experiencia. Cuenta con 6 bolsillos en los laterales para organizar material. Además, tiene un bolsillo al lado de cada puerta que sirve como recogedor rápido de esta, o como organizador de material. En el techo interior se ubica una bandeja porta material y unas cintas colgador.','[\"Carpa muy compacta.\", \"Resistente y transpirable.\", \"Costuras termoselladas.\", \"6 bolsillos organizadores de material.\", \"Protección UV\"]',NULL,0,0,'2024-01-29 17:54:50','2024-01-29 17:54:50'),(5,'Carpa Vessel Tunnel','Naturehike',262343.00,3,'camping','','','','Carpa de lujo amplia y cómoda ideal para 4 personas. ¡Glamping en estado puro! Sí, con su pantalla de proyección, esta carpa te permite crear tu propio autocine.\r\nCon sus inusuales divisiones, permite tener un dormitorio y una sala de estar integrados. El campamento perfecto para familias numerosas.','[\"Protección UV UPF50.\", \"Múltiples métodos de expansión.\", \"Un dormitorio y un salón.\", \"Espacio para chimeneas delantera y trasera extensibles, dos pares de puertas laterales.\", \"Impermeable y cortaviento.\"]',NULL,0,0,'2024-01-29 18:02:48','2024-01-29 18:02:48'),(6,'Milik Bolsa De Dormir','Ntk',66000.00,15,'camping','','','','Bolsa de dormir tipo sarcófago, lo que significa que puede mantener una temperatura uniforme y constante.\r\nEl rango de temperatura de la bolsa de dormir Milik es de 5 °C a 15 °C y pesa 1,1 kg. ¡Es un modelo súper liviano! Tiene un estampado de camuflaje exclusivo, que lo diferencia de todos los modelos del mercado.\r\nAdemás, su construcción proporciona mayor comodidad y sensación de descanso durante su uso.\r\nCabe mencionar que el tamaño del Milik es extra dimensionado, brindando mayor tranquilidad.\r\nViene con una bolsa compresora de transporte y una capucha curva que se adapta perfectamente a la cabeza.','[\"Temperatura Confort: 15° C.\", \"Temperatura límite: 5 ° C.\", \"Material interno: algodón (PolyCotton).\", \"Relleno: fibra hueca tipo Hollow-Fiber 200g/m2\", \"Dimensiones: largo 230 cm, ancho 80 cm. (55 cm en los pies)\"]',NULL,0,0,'2024-01-29 18:05:25','2024-01-29 18:05:25'),(7,'Bolsa De Dormir capucha','Naturehike',48000.00,5,'camping','','','','Con un capa exterior de poliéster 190T transpirable y repelente al agua, la bolsa de dormir Naturehike U350 garantiza que tengas una experiencia al aire libre seca y cómoda. El aislamiento sintético ofrece calor en todas las condiciones desde 6° C hasta aproximadamente 3° C. El cierre doble proporciona una ventilación rápida y mucho espacio para que sus pies no se sientan comprimidos.','[\"Temperatura Confort: 15° C.\", \"Temperatura límite: 5 ° C.\", \"Material interno: algodón (PolyCotton).\", \"Relleno: fibra hueca tipo Hollow-Fiber 200g/m2\", \"Dimensiones: largo 230 cm, ancho 80 cm. (55 cm en los pies)\"]',NULL,0,0,'2024-01-29 18:06:27','2024-01-29 18:06:27'),(8,'Andes 400 84Z','Naturehike',232000.00,5,'camping','','','','Bolsa de dormir (duvet 90/10) de 700 cuins con 180 g de relleno. Estructura en forma de momia, ideal cuando buscas ligereza con un gran rendimiento calorífico.','[\"Bolsillo interior\", \"Señales de emergencia en el interior del saco.\", \"Funda de compresión con infografía: Ø11 x 22 cm.\", \"Tensor reflectante.\", \"Dimensiones: largo 230 cm, ancho 80 cm. (55 cm en los pies)\"]',NULL,0,0,'2024-01-29 18:09:06','2024-02-01 17:11:23'),(9,'Snowbird 7 Duvet ','Naturehike',232000.00,5,'camping','','','','Bolsa de dormir tipo momia con relleno de duvet de 650FP','[\"[object HTMLInputElement]\", \"[object HTMLInputElement]\", \"[object HTMLInputElement]\"]',NULL,0,0,'2024-01-29 18:13:09','2024-01-29 18:13:09'),(10,'Aislante Piramidal Bicolor','Altus',22000.00,5,'camping','','','','Este aislante es un perfecto complemento para dormir en la carpa o al aire libre.','[\"Material: Polietileno densidad 30 kg/m3\", \"Dimensiones: 1.80m x 50cm x 10mm\", \"10 mm de espesor\"]',NULL,0,0,'2024-01-29 18:16:05','2024-01-29 18:16:05'),(11,'Aislante Piramidal Monocolor','Altus',21000.00,5,'camping','','','','Este aislante es un perfecto complemento para dormir en la carpa o al aire libre.','[\"Material: Polietileno densidad 30 kg/m3\", \"Dimensiones: 1.80m x 50cm x 10mm\", \"10 mm de espesor\"]',NULL,0,0,'2024-01-29 18:17:41','2024-01-29 18:17:41'),(12,'Aislante Plegable Standard','Altus',31800.00,3,'camping','','','','Aislante plegable de espuma ultra liviano 1.8cm. Presenta una forma de acordeón compacta con hoyuelos que atrapan el calor.','[\"El revestimiento aluminizado refleja el propio calor del cuerpo.\", \"Plegable\", \"Liviano\", \"Cómodo\", \"Impermeable\", \"Incluye bolsa de transporte\", \"Incluye elásticos para sujeción\"]',NULL,0,0,'2024-01-29 18:20:04','2024-01-29 18:20:04'),(13,'Sillon Inflable','Naturehike',42000.00,10,'camping','','','','El sofá inflable Naturehike es una forma de estar cómodo dondequiera que estés. Portátil y compacto, te permitirá descansar en cualquier lugar. Se necesita poco tiempo para desplegarlo e inflarlo.\r\n\r\nDimensiones: 180 x 70 x 52 cm\r\nEmbalado: 45 x 24 cm\r\nPeso: 630g','[\"Sofá inflable cómodo\", \"Las grandes dimensiones garantizan una comodidad considerable\", \"Portátil y compacto\", \"Cuando está plegado, cabe en una pequeña funda de mochila\", \"Peso inferior a 1 kg\", \"Sistema de inflado sin el uso de una bomba\", \"El perfil cómodo proporciona apoyo en todos los puntos\"]',NULL,0,0,'2024-01-29 18:22:44','2024-01-29 18:22:44'),(14,'Colchoneta Autoinflable','Naturehike',42061.00,5,'camping','','','','Colchoneta autoInflable gracias a una capa interna de esponja de alta resistencia. Incluye en su diseño una almohada de inflado manual.\r\nValvula de aire de gran diámetro para mayor velocidad de inflado y desinflado.\r\nIncluye una bolsa externa independiente para un almacenamiento práctico.\r\nEconómica y resistente. Es ideal para viajes de camping en auto donde transportar una colchoneta menos compacta no es un problema.\r\nPermite vincular varias colchonetas del mismo modelo entre sí gracias a unos botones en los laterales, permitiendo que las mismas permanezcan en su lugar durante su uso.','[\"[object HTMLInputElement]\", \"[object HTMLInputElement]\", \"[object HTMLInputElement]\", \"[object HTMLInputElement]\", \"[object HTMLInputElement]\"]',NULL,0,0,'2024-01-29 18:26:30','2024-01-29 18:26:30'),(15,'Baston 3 Secciones','Naturehike',114000.00,9,'montañismo','','','','El bastón de trekking ST06 de Naturehike está hecho de fibra de carbono premium y aluminio 7075, lo que lo hace ultraligero y excepcionalmente fuerte.','[\"[object HTMLInputElement]\", \"[object HTMLInputElement]\", \"[object HTMLInputElement]\"]',NULL,0,0,'2024-01-29 18:29:25','2024-02-09 20:56:47'),(17,'Brujula T10','Waterdog',23000.00,4,'montañismo','','','','Brujula T10 para Supervivencia','[\"Brújula\", \"Regla\", \"Silbato\", \"Higrómetro\", \"Termómetro\", \"Reflector\"]',NULL,0,0,'2024-01-29 18:34:53','2024-01-29 18:34:53'),(18,'Brujula Silbato Nautico','Spinit',8000.00,4,'montañismo','','','','Silbato náutico, una brújula de botón y un espacio estanco en el que transportar tus productos de supervivencia.\r\nIdeal para actividades náuticas, el silbato permite rescate y el compartimiento estanco mantener secos elementos como fósforos, etc. Si este espacio se encuentra vacío o con poco peso el silbato flota.','[\"[object HTMLInputElement]\", \"[object HTMLInputElement]\", \"[object HTMLInputElement]\"]',NULL,0,0,'2024-01-29 18:36:11','2024-01-29 18:36:11'),(19,'Kong Dhino Classic 50cm','Kong',151400.00,3,'montañismo','','','','Piqueta de alpinismo clásico con cuerpo de aluminio y pico y regatón de acero galvanizado.','[\"Empuñadura con acabado en grano diferenciado para mejorar el agarre.\", \"Dragonera de tejido, para evitar perderlo.\", \"Certificado CE EN 13089/1\", \"¡Producto de calidad completamente desarrollado y realizado en Italia!\"]',NULL,0,0,'2024-01-29 18:39:10','2024-01-29 18:39:10'),(20,'Piqueta Edelrid Attila Lite','Edelrid',174254.00,3,'montañismo','','','','Piqueta Attila Lite 45cm Piqueta versátil para tránsito glaciar y ski.','[\"El mango de aluminio ligeramente curvado y la hoja de acero endurecido hacen que el terreno empinado alpino sea tarea fácil.\", \"Pala ancha para un corte por pasos eficiente\", \"Centro marcado para la configuración de anclaje en T\", \"Hoja de forma ergonómica perfecta para una inmersión suave en la subida\", \"Diseño ultraligero y compacto para un peso mínimo y un tamaño pequeño.\"]',NULL,0,0,'2024-01-29 18:41:57','2024-01-29 18:41:57'),(21,'Navaja Victorinox Waiter','Victorinox',24500.00,15,'montañismo','','','','En un brindis a la preparación, sacamos nuestra clásica navaja para oficiales y le dimos un pequeño giro para los amantes del vino, literalmente. Con su sacacorchos siempre listo para entrar en acción, la navaja de bolsillo Waiter nunca te abandonará. Tinto, blanco, burbujeante... el vino siempre tiene un mejor sabor cuando estás bien preparado.','[\"Una herramienta para que los amantes del vino lleven siempre consigo\", \"Navaja de bolsillo fabricada en Suiza con 9 funciones\", \"Incluye herramienta de combinación y sacacorchos\", \"Hoja grande Sacacorchos Palillo de dientes Destapador 5. Abrelatas 6. Destornillador 5 mm Pela cables Pinzas Anilla\"]',NULL,0,0,'2024-01-29 18:45:50','2024-01-29 18:45:50'),(22,'Navaja Acero Al Carbono','Opinel',27092.00,15,'montañismo','','','','Opinel Navaja Nro8 Acero Al Carbono\r\nConcebido para las actividades durante y después de la caza mayor. Adaptado a la pesca y la observación de la naturaleza. El tradicional de Opinel.','[\"Simplemente la referencia de la navaja \\\"made in France\\\". El N°08 Carbono fue creado en el taller de Joseph Opinel en la década de 1890. Desde entonces, se ha convertido en un clásico en todo el mundo, gracias en particular a su diseño y eficacia.\", \"Su hoja de 8,5 cm de acero al carbono ofrece un excelente corte afilado y una gran durabilidad.\", \"El mango de haya facilita la sujeción y, por lo tanto, hace que la navaja sea más segura.\", \"El sistema de seguridad Virobloc, inventado por Opinel, permite bloquear la hoja en posición abierta y cerrada.\"]',NULL,0,0,'2024-01-29 18:47:56','2024-01-29 18:47:56'),(24,'Arnes Moe 3','Edelrid',115356.00,8,'escalada','','','','Arnés de escalada deportivo moderno y cómodo con perneras ajustables para un ajuste perfecto.','[\"Construcción de ajuste central: acolchado móvil en las caderas para ajustar y colocar el arnés de manera óptima\", \"Las hebillas DoubleBack tienen una forma determinada para facilitar su regulacion y ayudan a prevenir manipulaciones incorrectas\", \"4 portamateriales simétricos y 2 opciones de fijación para portamaterial de hielo\", \"Anilla ventral con un indicador que revela hilos rojos en caso de mayor desgaste, lo que indica que es hora de reemplazar el arnés\", \"Anilla ventral con protector contra abrasiones de Dyneema®\", \"Bolsa pequeña en el arnés para acomodar el chip RFID\", \"Hecho de materiales certificados por bluesign®\"]',NULL,0,0,'2024-01-29 18:53:28','2024-01-29 18:53:28'),(26,'Pedula Cobra','La Sportiva',153000.00,3,'escalada','','','','Fácil de calzar. Las principales características de esta revolucionaria bailarina son el confort exclusivo, la sensibilidad y la precisión que ofrece. Su fina media suela proporciona un apoyo óptimo en las fisuras, sin por ello disminuir la adherencia y la sensibilidad.','[\"Parte superior en piel sin forro cortada a una sola pieza que se adapta perectamentea cualquier pie.\", \"Particular suela interior que permite a los dedos lograr una excelente sensitividady agarre.\", \"Parte superior en piel sin forro cortada a una sola pieza que se adapta perectamentea cualquier pie.\", \"Superior bi-color realizado en PermaTan: garantiza la estabilidad del color evitando que desaparezca en contacto con la piedra, incluso con sudoración elevada.\"]',NULL,0,0,'2024-01-29 18:57:15','2024-01-29 18:57:15'),(27,'Casco Venturi','Edelweiss',153000.00,10,'escalada','','','','Casco Ultraliviano Edelweiss Venturi','[\"Casco de poliestireno para alpinismo y escalada, con una carcasa de policarbonato resistente y espuma interior de EPS para difundir la fuerza de impacto, cómodo y ventilado por 14 respiraderos grandes.\", \"Ajuste de tamaño mediante ajustador de rueda. Clips de faros para asegurar su iluminación\", \"La fuerza de la correa de la barbilla es superior a 50 daN para garantizar que el casco permanezca seguro durante un impacto.\", \"Cierre por innovadora hebilla magnética súper fácil de manejar incluso con guantes. Acolchado de confort extraíble y lavable.\", \"Gracias al poliestireno expandido la energía de los impactos se disipa de forma increíble, este recubrimiento interno rodea toda la cabeza y absorbe tanto impactos verticales como laterales.\", \"Ideal para vías de varios largos, cuando debe llevarse durante toda la jornada y para tus aventuras alpinas gracias a su reducido peso.\"]',NULL,0,0,'2024-01-29 19:01:05','2024-01-29 19:01:05'),(28,'Casco Edelrid','Edelrid',115449.00,9,'escalada','','','','Edelrid Ultralight Casco de escalada\r\n \r\nEl nuevo ULTRALIGHT tiene un diseño moderno, una ventilación mejorada y una nueva correa reemplazable y lavable para la cabeza y la barbilla. Se ha mantenido la estructura extremadamente robusta. El casco definitivo para instalaciones comerciales como escuelas de escalada y parques de aventura.','[\"Carcasa de polipropileno extremadamente robusta y resistente a los impactos\", \"Correa para la cabeza y la barbilla totalmente ajustable, reemplazable y lavable para un ajuste óptimo\", \"Posibilidad de acoplar una linterna frontal\", \"Varias rejillas de ventilación para un intercambio de aire continuo\", \"Posibilidad de acoplar una linterna frontal\", \"Talla única: se ajusta a un perímetro craneal de 54-60 cm\", \"Sistema de transporte cómodamente acolchado con cinchas antibacterianas\"]',NULL,0,0,'2024-01-29 19:04:17','2024-01-29 19:04:17'),(29,'Mosqueton Vision','Singing Rock',15000.00,25,'escalada','','','','Mosquetón de leva recta de alambre\r\nEste mosquetón recto Singing Rock Vision es el mosquetón más ligero con gatillo de alambre para las ascensiones más exigentes. Es un mosquetón pequeño tipo B (con forma de D) de aleación de aluminio anodizado forjado en caliente. Idóneo para reuniones, autoaseguramientos y para usar con cintas exprés. Su apertura de cierre es de 19 mm (la mínima requerida para mosquetones tipo B es de 15 mm).\r\n\r\nCuenta con un diseño ergonómico y una estructura construida de forma que el mosquetón sea súper ligero – pesa 33 gramos – y aun así resulte muy resistente.','[\"Mosquetón en forma de D (tipo B)\", \"Gatillo recto de alambre\", \"Fabricado en aleación de aluminio ligera (excepto el gatillo)\", \"Ideal para usar en reuniones, autoaseguramientos y con cintas exprés de seguridad\", \"Apertura de cierre de 19 mm (la mínima requerida para mosquetones tipo B es de 15 mm)\", \"Resistencia de 8 kN con el cierre abierto\", \"Resistencia de 25 kN en el eje mayor (con cierre cerrado)\"]',NULL,0,0,'2024-01-29 19:11:26','2024-01-29 19:11:26'),(37,'Producto de prueba','Cualquiera',456.00,5,'montañismo','','','',NULL,NULL,NULL,0,0,'2024-02-09 20:10:42','2024-02-09 20:10:42');
